Async/await in TypeScript provides a cleaner syntax for handling Promises:

1. **async functions** always return a Promise
2. **await** pauses execution until a Promise resolves

```typescript
async function fetchData(): Promise<Data> {
  const response = await fetch('/api/data');
  const data = await response.json();
  return data;
}
```

TypeScript adds type safety by inferring Promise types and catching errors at compile time.
